'''
牛牛和牛妹都很聪明
经典博弈论题目，倒推就行了
某个人输代表当前轮到他，且石子数为(1,1),(0,n)
考虑1,n和1,1
1,1的前身是3,2
也就是谁先遇到3,2谁先赢，

0,n的前身是1,n+2或者2,n+1

思考4,3
1:    3,1,shu    2,2,shu

思考5,3
1:    4,1,shu    3,2,shu

不难发现，小的数先小于3的那个人输，那么就要通过控1,2来让小的那个数到对手的时候小于等于3
也就是要拿到4,5
也就是不能让对手拿到4,5
也就是要让对手拿到6,7，就是自己拿到8----让对手拿10，11，对手不管1,2自己都可以反过来，然后拿到8，就赢了
不难发现，不管对手选择1还是2，自己都可以选另一个，让这一轮的数字稳定下降3
也就是7以上的三的倍数都没有意义
所以直接将最小值一直减三直到在范围8,9,10之间



'''
