def grundy(a, b, memo):
    if a < 2 and b < 2:
        return 0
    if (a, b) in memo:
        return memo[(a, b)]
    g = min(grundy(a - 1, b - 2, memo), grundy(a - 2, b - 1, memo))
    memo[(a, b)] = g
    return g

def solve(a, b):
    memo = {}
    grundy_value = grundy(a, b, memo)
    if grundy_value == 0:
        return "niumei"
    else:
        return "niuniu"

t = int(input())

for _ in range(t):
    a, b = map(int, input().split())
    print(solve(a, b))

